import React from 'react';
import { motion } from 'framer-motion';
import { 
  FaReact, FaNodeJs, FaJs, FaPython, FaDatabase, FaAws, 
  FaDocker, FaGithub, FaHtml5, FaCss3Alt, FaBootstrap 
} from 'react-icons/fa';
import { SiTypescript, SiMongodb, SiPostgresql, SiRedis, SiKubernetes } from 'react-icons/si';

const Skills = () => {
  const skillCategories = [
    {
      title: "Frontend Development",
      skills: [
        { name: "React", icon: <FaReact /> },
        { name: "JavaScript", icon: <FaJs /> },
        { name: "TypeScript", icon: <SiTypescript /> },
        { name: "HTML5", icon: <FaHtml5 /> },
        { name: "CSS3", icon: <FaCss3Alt /> },
        { name: "Bootstrap", icon: <FaBootstrap /> }
      ]
    },
    {
      title: "Backend Development",
      skills: [
        { name: "Node.js", icon: <FaNodeJs /> },
        { name: "Python", icon: <FaPython /> },
        { name: "Express.js", icon: <FaNodeJs /> },
        { name: "REST APIs", icon: <FaDatabase /> },
        { name: "GraphQL", icon: <FaDatabase /> }
      ]
    },
    {
      title: "Databases & Cloud",
      skills: [
        { name: "MongoDB", icon: <SiMongodb /> },
        { name: "PostgreSQL", icon: <SiPostgresql /> },
        { name: "Redis", icon: <SiRedis /> },
        { name: "AWS", icon: <FaAws /> },
        { name: "Docker", icon: <FaDocker /> },
        { name: "Kubernetes", icon: <SiKubernetes /> }
      ]
    },
    {
      title: "Tools & Others",
      skills: [
        { name: "Git", icon: <FaGithub /> },
        { name: "CI/CD", icon: <FaGithub /> },
        { name: "Agile", icon: <FaGithub /> },
        { name: "Testing", icon: <FaGithub /> }
      ]
    }
  ];

  return (
    <section id="skills" className="py-20 bg-terminal-bg">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <motion.div
          initial={{ opacity: 0, y: 50 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl font-bold text-terminal-text mb-4">Skills & Technologies</h2>
          <div className="w-24 h-1 bg-primary-500 mx-auto glow-effect"></div>
        </motion.div>

        <div className="space-y-12">
          {skillCategories.map((category, categoryIndex) => (
            <motion.div
              key={categoryIndex}
              initial={{ opacity: 0, y: 30 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: categoryIndex * 0.1 }}
              viewport={{ once: true }}
              className="bg-terminal-bg border border-terminal-accent/20 p-6 rounded-lg hover:border-primary-500/50 transition-all duration-300 glow-effect"
            >
              <h3 className="text-xl font-bold text-terminal-text mb-6 text-center">
                {category.title}
              </h3>

              <div className="grid grid-cols-2 sm:grid-cols-3 md:grid-cols-4 lg:grid-cols-6 gap-4">
                {category.skills.map((skill, skillIndex) => (
                  <motion.div
                    key={skillIndex}
                    initial={{ opacity: 0, scale: 0.8 }}
                    whileInView={{ opacity: 1, scale: 1 }}
                    transition={{ duration: 0.4, delay: skillIndex * 0.05 }}
                    viewport={{ once: true }}
                    whileHover={{ scale: 1.05, y: -2 }}
                    className="flex flex-col items-center p-4 rounded-lg hover:bg-terminal-accent/10 transition-all duration-200 group"
                  >
                    <div className="text-primary-500 text-2xl mb-2 group-hover:text-primary-400 transition-colors duration-200">
                      {skill.icon}
                    </div>
                    <span className="font-medium text-terminal-text text-sm text-center group-hover:text-terminal-accent transition-colors duration-200">
                      {skill.name}
                    </span>
                  </motion.div>
                ))}
              </div>
            </motion.div>
          ))}
        </div>

        {/* Summary Stats */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.4 }}
          viewport={{ once: true }}
          className="mt-16 text-center"
        >
          <div className="bg-terminal-bg border border-primary-500/30 p-8 rounded-lg glow-effect">
            <h3 className="text-2xl font-bold text-terminal-text mb-4">
              Technical Expertise Summary
            </h3>
            <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
              <div className="text-center">
                <div className="text-3xl font-bold text-primary-500 glow-effect">20+</div>
                <div className="text-terminal-text/80">Technologies</div>
              </div>
              <div className="text-center">
                <div className="text-3xl font-bold text-primary-500 glow-effect">4</div>
                <div className="text-terminal-text/80">Core Areas</div>
              </div>
              <div className="text-center">
                <div className="text-3xl font-bold text-primary-500 glow-effect">3+</div>
                <div className="text-terminal-text/80">Years Experience</div>
              </div>
            </div>
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default Skills;
